import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router";

export default function MainPageDisplay() {
    const navigate = useNavigate();

    async function click(e) {
        e.preventDefault();

        navigate("/buySellPage");
    }

    return (
        <div></div>
    )
}
